import "./styles/categories.css";
function Categories({ categoryList, selectCategory }) {
  return (
    <div className="categories">
      {categoryList.map((cat, index) => (
        <p key={index} onClick={selectCategory}>
          {cat}
        </p>
      ))}
    </div>
  );
}

export default Categories;
